    [],nt"revision_timestamp": "2016-05-25T01:00:12.390840",nt"name": "transportation-and-health-tool-data",nt"isopen":
    true,nt"url": null,nt"notes": "The Transportation and Health Tool (THT)
    was developed by the U.S. Department of Transportation and the Centers for Disease
    Control and Prevention to provide easy access to data that practitioners can use
    to examine the health impacts of transportation systems. The tool provides data
    on a set of transportation and public health indicators for each U.S. state and
    metropolitan area that describe how the transportation environment affects safety,
    active transportation, air quality, and connectivity to destinations. You can use
    the tool to quickly see how your state or metropolitan area compares with others
    in addressing key transportation and health issues. It also provides information
    and resources to help agencies better understand the links between transportation
    and health and to identify strategies to improve public health through transportation
    planning and policy.",nt"license_title": "U.S. Government Work",nt"extras":
